CREATE TABLE HIS (
    patient_id INT PRIMARY KEY,
    name VARCHAR(255),
    date_of_birth DATE,
    gender VARCHAR(10),
    marital_status VARCHAR(20),
    address VARCHAR(255),
    city VARCHAR(100),
    area VARCHAR(100),
    zip_code VARCHAR(20),
    country VARCHAR(100),
    nationality VARCHAR(100),
    phone_number VARCHAR(20),
    email_address VARCHAR(255),
    insurance_provider VARCHAR(255),
    insurance_id VARCHAR(50)
);
